import React, { PropTypes } from 'react'
import _ from 'lodash'
import { connect } from 'react-redux'
import { bindActionCreators } from 'redux'
import request from 'superagent'

import * as zoomActions from '../../actions/zoomActions'

import {  FontPanel,
          ColorPanel,
          LayoutPanel,
          SectionTypePanel,
          ImagePanel,
          ComponentPanel } from './toolPanel'

class ToolPanel extends React.Component{
  constructor(props){
    super(props)

    this.state = {
      active: 'none',
      id: props.id,
      styles: props.styles,
      fontFamilies: props.fontFamilies,
      colors: props.colors,
      meta: props.meta,
      rendered_pdf: props.rendered_pdf,
      rendered_pdf_file_name: props.rendered_pdf_file_name,
      saving: props.saving,
      zoom: props.zoom
    }
  }

  componentWillReceiveProps(nextProps){
    this.setState({
      id: nextProps.id,
      colors: nextProps.colors,
      fontFamilies: nextProps.fontFamilies,
      rendered_pdf: nextProps.rendered_pdf,
      rendered_pdf_file_name: nextProps.rendered_pdf_file_name,
      saving: nextProps.saving,
      styles: nextProps.styles,
      meta: nextProps.meta,
      zoom: nextProps.zoom
    })
  }

  onToggleActive = (active) => {
    this.setState({active})
  }

  getStyles = (styleId) => {
    const { styles, fontFamilies, colors, zoom } = this.state
    const index = _.findIndex(styles, (s, i) => {return s.id === styleId})

    return {
      ...styles[index].extra,
      fontSize: `${styles[index].extra.fontSize*zoom/100}pt`,
      color: `${colors[styles[index].color]}`,
      fontFamily: fontFamilies[styles[index].fontFamily].fontFamily,
      fontWeight: fontFamilies[styles[index].fontFamily].fontWeight,
      fontStyle: fontFamilies[styles[index].fontFamily].fontStyle,
      textTransform: fontFamilies[styles[index].fontFamily].textTransform,
    }
  }

  previewCall = (zoom) => {
    const { meta } = this.state
    const { applyZoom } = this.props.zoomActions
    const html = document.getElementById('entry-point').outerHTML
    const req = request.post(`/menus/export`)
    req.query({ format: 'json' })
    req.field('authenticity_token', $('meta[name="csrf-token"]').attr('content') )
    req.field('html', html)
    req.field('meta', JSON.stringify(meta))
    req.end((err, res)=>{
      applyZoom(zoom)
      window.open(res.body.path, "_blank")
    })
  }

  onPreview = () => {
    const { applyZoom } = this.props.zoomActions
    const { zoom } = this.state

    applyZoom(100)
    setTimeout(this.previewCall(zoom), 100)
  }

  onExport = () => {
    console.log("export call")
    var a = document.createElement('a')
    a.href = this.state.rendered_pdf
    a.download = this.state.rendered_pdf_file_name
    a.click()
  }

  render(){
    const { active, meta, id, saving } = this.state

    return(
      <section className="tool-panel" style={{padding: 25}}>
        <header>
          <img src={roboLogo} alt="Twik Robo Logo" style={{display: 'block', height: 75, margin: '0 auto'}}/>
          <hr style={{marginBottom: 0, borderBottom: '1.5px solid black'}}/>
        </header>
        <div className="row" style={{marginBottom: 100}}>
          <div className="col-xs-12">
            {active !== 'color' && _.findIndex(meta.allows, (f) => { return f === 'color' }) !== -1 && <button className="btn-toolpanel btn-block" onClick={(e) => {this.onToggleActive('color')}}>Color</button>}
            {active === 'color' &&
              <ColorPanel
                onClose={(e) => {this.onToggleActive('none')}}
              />
            }
            {active !== 'font' && _.findIndex(meta.allows, (f) => { return f === 'font' }) !== -1 && <button className="btn-toolpanel btn-block" onClick={(e) => {this.onToggleActive('font')}}>Font</button>}
            {active === 'font' &&
              <FontPanel
                onClose={(e) => {this.onToggleActive('none')}}
              />
            }
            {active !== 'layout' && _.findIndex(meta.allows, (f) => { return f === 'layout' }) !== -1 && <button className="btn-toolpanel btn-block" onClick={(e) => {this.onToggleActive('layout')}}>Layout</button>}
            {active === 'layout' &&
              <LayoutPanel
                onClose={(e) => {this.onToggleActive('none')}}
              />
            }
            {active !== 'add-section' && _.findIndex(meta.allows, (f) => { return f === 'component' }) !== -1 && <button className="btn-toolpanel btn-block" onClick={(e) => {this.onToggleActive('add-section')}}>Add Component</button>}
            {active === 'add-section' &&
              <ComponentPanel
                onClose={(e) => {this.onToggleActive('none')}}
                getStyles={this.getStyles}
              />
            }
            {active !== 'image-wiz' && _.findIndex(meta.allows, (f) => { return f === 'image' }) !== -1 && <button className="btn-toolpanel btn-block" onClick={(e) => {this.onToggleActive('image-wiz')}}>Image Library</button>}
            {active === 'image-wiz' &&
              <ImagePanel
                onClose={(e) => {this.onToggleActive('none')}}
                getStyles={this.getStyles}
              />
            }
          </div>
        </div>
        <div className="row">
          <div className="col-xs-6">
            <button className="btn-toolpanel-action btn-block" onClick={(e) => {
              if(this.props.mode === "edit" || id !== null){
                this.props.onUpdate(e)
              }
              else{
                this.props.onSave(e)
              }
            }} disabled={saving}>{saving ? 'Saving...' : 'Save'}</button>
          </div>
          <div className="col-xs-6">
            <button className="btn-toolpanel-action btn-block" onClick={(e) => {this.onPreview()}}>Preview</button>
          </div>
          {(this.props.mode === "edit" || id !== null) && this.state.rendered_pdf !== "/rendered_pdfs/original/missing.png" &&
            <div className="col-xs-12">
              <button className="btn-toolpanel-action btn-block" onClick={(e) => {this.onExport()}}>Export</button>
            </div>
          }
        </div>

      </section>
    )
  }
}

ToolPanel.propTypes = {
}

function mapStateToProps(state, ownProps){
  console.log(state)
//  debugger;
  return {
    id: state.menu.object.id,
    colors: state.colors,
    fontFamilies: state.fontFamilies,
    meta: state.meta,
    rendered_pdf: state.menu.object.rendered_pdf,
    rendered_pdf_file_name: state.menu.object.rendered_pdf_file_name,
    saving: state.saving,
    sections: state.sections,
    structure: state.structure,
    styles: state.styles,
    zoom: state.zoom,
  }
}

function mapDispatchToProps(dispatch){
  return {
    zoomActions: bindActionCreators(zoomActions, dispatch)
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(ToolPanel)

const roboLogo = 'data:image/png;base64,'
